import React, { useEffect, useState } from 'react';
import { t, getLang, onLangChange } from '../../translation';

export default function Footer() {
  const [lang, setLangState] = useState(getLang());
  useEffect(() => {
    const off = onLangChange(() => setLangState(getLang()));
    return off;
  }, []);
  return (
    <>
      <div className="bg-gray-100 mt-[400px]">
        <footer
          style={{ fontFamily: 'S-CoreDream-4Regular' }}
          className="flex justify-center mt-20 py-12 bg-gray-100"
        >
          <section className="flex justify-between items-start gap-24 w-[1400px]">
            <div>
              <img src="/authrium_logo.png" alt="오스리움" className="h-[28px] w-36" />
            </div>
            <div className="w-full flex justify-between">
              <ul className="flex gap-12 m-0">
                <li className="list-none">
                  <a
                    href=""
                    className="text-[15px] font-bold leading-[15px] no-underline"
                  >
                    {t('page.footer.terms')}
                  </a>
                </li>
                <li className="list-none">
                  <a
                    href=""
                    className="text-[15px] font-bold leading-[15px] no-underline"
                  >
                    {t('page.footer.privacy')}
                  </a>
                </li>
              </ul>
              <div>
                <a
                  href="mailto:avataroad@authrium.com"
                  className="text-[15px] font-bold leading-[15px] no-underline"
                >
                  {t('page.footer.email')}
                </a>
                <p
                  style={{ color: '#777' }}
                  className="text-[13px] font-light  no-underline"
                >
                  {t('page.footer.copyright')}
                </p>
              </div>
            </div>
          </section>
        </footer>
      </div>
    </>
  );
}
